import { Avatar } from '@material-ui/core';
import {Grid} from '@ma'
export default function avatar() {
    return (
        <Grid>
            <Avatar alt="Ricky ProfPic" src="../../../assests/images/Ray.jpg" className={classes.bigAvatar}></Avatar>
        </Grid>
    )
}
